import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Nav.css';

const Nav = () => {
  return (
    <nav className='navbar'>
      <ul className='navbar-list'>
        <li className='navbar-list-item'>
          <Link className='navbar-list-item__link' to='/'>
            Home
          </Link>
        </li>
        <li className='navbar-list-item'>
          <Link className='navbar-list-item__link' to='/generator'>
            Generator
          </Link>
        </li>
        <li className='navbar-list-item'>
          <Link className='navbar-list-item__link' to='/palettes'>
            Palettes
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
